.cardContainer{
    position: relative;
    width: 320px;
    height: 450px;
    background-color: #232323;
    border-radius: 20px;
    overflow: hidden;
    &:before{
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-color: #a2232e;
        clip-path: circle(150px at 80% 20%);
        transition: 0.5s ease-in-out;
    }
    &__after{
        position: absolute;
        top: 10%;
        left: -10%;
        height: 100%;
        width: 100%;
        p{
            line-height: 135px;
            font-size: 12em;
            font-weight: 800;
            font-style: italic;
            color: rgba(255, 255, 255, 0.04);
        }
    }
    &__imgBox{
        &.img02{
            display: none;
        }
        &.img03{
            display: none;
        }
        position: absolute;
        top: 50%;
        transform: translateY(-75%);
        z-index: 300;
        width: 100%;
        height: 200px;
        transition: 1s;
        .imgBox{
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) rotate(-25deg) scaleX(-1);
            width: 270px;
        }
    }
    &__content{
        display: flex;
        flex-direction: column;
        align-items: center;
        position: absolute;
        bottom: 0;
        width: 100%;
        height: 100px;
        text-align: center;
        transition: 1s;
        z-index: 10;
        h2{
            position: relative;
            font-weight: 600;
            letter-spacing: 1px;
            color: #fff;
        }
        a{
            display: inline-block;
            padding: 10px 20px;
            background-color: #fff;
            border-radius: 4px;
            margin-top: 10px;
            text-decoration: none;
            font-weight: 600;
            color: #111;
            opacity: 0;
            transform: translateY(50px);
            transition: 0.5s;
        }
    }
    &__size, &__color{
        display: flex;
        justify-content: center;
        align-items: center;
        padding: 8px 20px;
        transition: 0.5s;
        opacity: 0;
        visibility: hidden;
        h3{
            color: #fff;
            font-weight: 300;
            font-size: 14px;
            text-transform: uppercase;
            letter-spacing: 2px;
            margin-right: 10px;
            margin-bottom: 0;
        }
        span, button{
            width: 26px;
            height: 26px;
            text-align: center;
            line-height: 26px;
            font-size: 14px;
            display: inline-block;
            color: #111;
            background-color: #fff;
            margin: 0 5px;
            transition: 0.5s;
            color: #111;
            border-radius: 5px;
            cursor: pointer;
            &:hover{
                background-color: #024281;
                color: #fff;
            }
        }
    }
    &__color{
        button{
            border-radius: 100px;
            position: relative;
            overflow: hidden;
            -webkit-box-shadow: 0px 0px 30px 5px rgba(0,0,0,0.35);
            -moz-box-shadow: 0px 0px 30px 5px rgba(0,0,0,0.35);
            box-shadow: 0px 0px 30px 5px rgba(0,0,0,0.35);
            border: 0;
            &:nth-child(2){
                background-color: #a2232e;
                &:before{
                    content: '';
                    width: 200%;
                    height: 200%;
                    background-color: #024281;
                    top: -2px;
                    left: -147%;
                    position: absolute;
                    z-index: 5;
                    transform: rotate(45deg);
                }
            }
            &:nth-child(3){
                background-color: #f0c600;
                &:before{
                    content: '';
                    width: 200%;
                    height: 200%;
                    background-color: #81027a;
                    top: -2px;
                    left: -147%;
                    position: absolute;
                    z-index: 5;
                    transform: rotate(45deg);
                }
            }
            &:nth-child(4){
                background-color: #f400d4;
                &:before{
                    content: '';
                    width: 200%;
                    height: 200%;
                    background-color: #05cb00;
                    top: -2px;
                    left: -147%;
                    position: absolute;
                    z-index: 5;
                    transform: rotate(45deg);
                }
            }
            &:hover{
                border: 2px solid #fff;
            }
        }
    }
    &:hover{
        .cardContainer__imgBox{
            top: 5%;
            transform: translateY(0%);
        }
        .cardContainer__content{
            height: 210px;
            .cardContainer__size{
                opacity: 1;
                visibility: visible;
                transition-delay: 0.5s;
            }
            .cardContainer__color{
                opacity: 1;
                visibility: visible;
                transition-delay: 0.5s;
            }
            a{
                opacity: 1;
                transform: translateY(0px);
                transition-delay: 0.75s;            
                &:hover{
                    background-color: #024281;
                    color: #fff;
                    transition-delay: 0s;
                }
            }
        }
        &:before{
            clip-path: circle(300px at 80% 20%);
        }
    }

    &.changeColor01{
        &:before{
            content: '';
            background-color: #a2232e;
        }
        .cardContainer__imgBox{
            &.img01{
                display: initial;
            }
            &.img02{
                display: none;
            }
            &.img03{
                display: none;
            }
        }
        .cardContainer__size{
            span{
                &:hover{
                    background-color: #024281;
                }
            }
        }
        &:hover{
            a{
                &:hover{
                    background-color: #024281;
                }
            }
        }
    }
    &.changeColor02{
        &:before{
            content: '';
            background-color: #f0c600;
        }
        .cardContainer__imgBox{
            &.img01{
                display: none;
            }
            &.img02{
                display: initial;
            }
            &.img03{
                display: none;
            }
        }
        .cardContainer__size{
            span{
                &:hover{
                    background-color: #81027a !important;
                }
            }
        }
        &:hover{
            a{
                &:hover{
                    background-color: #81027a !important;
                }
            }
        }
    }
    &.changeColor03{
        &:before{
            content: '';
            background-color: #f400d4;
        }
        .cardContainer__imgBox{
            &.img01{
                display: none;
            }
            &.img02{
                display: none;
            }
            &.img03{
                display: initial;
            }
        }
        .cardContainer__size{
            span{
                &:hover{
                    background-color: #05cb00 !important;
                    color: #232323 !important;
                }
            }
        }
        &:hover{
            a{
                &:hover{
                    background-color: #05cb00 !important;
                    color: #232323 !important;
                }
            }
        }
    }
}

